import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import HabitsList from "./components/habits-list.component";
import EditHabit from "./components/edit-habit.component";
import CreateUser from "./components/create-user.component";
import CreateHabit from "./components/create-habit.component";
import Home from "./components/home.component";
import Dashboard from "./components/dashboard.component";

function App() {
  return (
    <Router>
      <div className="container">
        <Route path="/" exact component={Home} />
        <Route path="/dashboard" exact component={Dashboard} />
        <Route path="/habits" exact component={HabitsList} />
        <Route path="/edit/:id" exact component={EditHabit} />
        <Route path="/create" exact component={CreateHabit} />
        <Route path="/user" exact component={CreateUser} />
      </div>
    </Router>
  );
}

export default App;
